assets目录： 放置未编译资产如（样式， 图片， 字体， js组件）
static目录： 这个目录映射到服务跟目录，用来放置不变的静态资源 如favicon  
nuxt.config.js文件：Nuxt配件文件
middleware目录： 存放应用的中间件 
